import React from 'react'
import Modal from '../Modal.js'



const StreamDelete = () => {
	const actions = (
		<div>
			<button className="ui red button">{this.props.primary} </button>
			<button className="ui button">{this.props.secondary} </button>
		</div>


	); 

	return(
		<div>
			StreamDelete
			<Modal header="Delete Stream" content="Are you sure"  />
		</div>

	)

}



export default StreamDelete;
